import { ACTIONS } from "../actions";

const initState = {
    mixer: {
        low: {
            frequency: 350
        },
        mid: {
            Q:2,
            frequency: 1000
        },
        hi: {
            frequency: 2500
        }
    }
}

function configuraionReducer(state = initState, action){
    switch(action.type){

        
        default : return state;
    }
}

export default configuraionReducer;
